// 画像描画関数の実装
void cImage_write(const CImage* img, int16_t x, int16_t y) {
    uint8_t b_count = 0;
    uint8_t w_count = 0;
    uint16_t x_cur = x;
    uint16_t y_cur = y;
    
    for (uint16_t i = 0; i < img->size; i++) {
        b_count = img->data[i] >> 4;
        w_count = img->data[i] & 0x0f;
        
        for (uint8_t j = 0; j < b_count; j++) {
            tft.drawPixel(x_cur, y_cur, ILI9341_BLACK);
            x_cur++;
            if (x_cur >= x + img->width) {
                x_cur = x;
                y_cur++;
            }
        }
        
        for (uint8_t j = 0; j < w_count; j++) {
            tft.drawPixel(x_cur, y_cur, ILI9341_WHITE);
            x_cur++;
            if (x_cur >= x + img->width) {
                x_cur = x;
                y_cur++;
            }
        }
    }
}

void cImage_writeSlide(const CImage* img, uint8_t offset, uint16_t color, 
                      int16_t x, int16_t y) {
    uint8_t b_count = 0;
    uint8_t w_count = 0;
    uint16_t x_cur = x;
    uint16_t y_cur = y;
    
    for (uint16_t i = 0; i < img->size; i++) {
        b_count = img->data[i] >> 4;
        w_count = img->data[i] & 0x0f;
        
        for (uint8_t j = 0; j < b_count; j++) {
            x_cur++;
            if (x_cur >= x + img->width) {
                x_cur = x;
                y_cur++;
            }
        }
        
        for (uint8_t j = 0; j < w_count; j++) {
            if (y_cur < y + offset) {
                tft.drawPixel(x_cur, y_cur, ILI9341_BLACK);
            } else {
                tft.drawPixel(x_cur, y_cur, color);
            }
            x_cur++;
            if (x_cur >= x + img->width) {
                x_cur = x;
                y_cur++;
            }
        }
    }
}
